**Describe the bug**
Hi, this is my first time using onnxruntime c++ api, and when I initialize session(env, model_path, session_options) I get an exception that says "0xc0000005: an access violation occurred while reading position 0xffffffffffffffff". I guess this may be related to the c++ pointer, can anyone provide some ideas about how to deal with this ?

`#include <assert.h>
#include <vector>
#include <ctime>
#include <onnxruntime_cxx_api.h>

int main()
{
    //记录程序运行时间
    auto start_time = clock();
    //初始化环境，每个进程一个环境
    //环境保留了线程池和其他状态信息
    Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "test");
    //初始化Session选项
    Ort::SessionOptions session_options;
    session_options.SetIntraOpNumThreads(1);
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);
    const wchar_t* model_path = L"yi_tsm_94989.onnx";
    printf("This is %ls\n", model_path);
    printf("Using Onnxruntime C++ API\n");
    
    Ort::Session session(env, model_path, session_options);
    //Ort::AllocatorWithDefaultOptions allocator;
    //// print number of model input nodes
    //size_t num_input_nodes = session.GetInputCount();
    //std::vector<const char*> input_node_names = { "input" };
    //std::vector<const char*> output_node_names = { "output" };
}`

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): win10
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: v1.6.0
- Visual Studio version (if applicable): vs2019

1. Switch to concurrent kernel profiling in case cupti prevent kernels from running in parallel on multiple streams, despite that ort cuda EP for now only occupies a single stream;
